/*
 * SETUP
 *	1 - Replace '[DATABASE_NAME]' by the target database name
 *	2 - Run the script
 *
 * For EXTERNAL_ACCESS && UNSAFE
 *	1 - Uncomment ALTER DATABASE [DATABASE_NAME] SET TRUSTWORTHY ON
 *  2- 	Uncomment either:
 *		- WITH PERMISSION_SET = EXTERNAL_ACCESS
 *		- WITH PERMISSION_SET = UNSAFE
 *
 * SQL Azure:
 *  1- Comment the sp_configure section (or leave it uncommented, the script will run even with the error)
 */

USE [DATABASE_NAME]
GO

-- Required for: EXTERNAL_ACCESS && UNSAFE permission
-- ALTER DATABASE [DATABASE_NAME] SET TRUSTWORTHY ON
GO


-- THIS line fail on SQL Azure, don't worry!
sp_configure 'clr enabled', 1;
GO
RECONFIGURE;
GO

BEGIN TRY;
    BEGIN TRAN;

	/*
	 * UNINSTALL
	 */
    PRINT N'Uninstall old version...';
    IF OBJECT_ID('SQLNET_EvalResultSet') IS NOT NULL
        BEGIN		
            DROP PROCEDURE SQLNET_EvalResultSet;
        END;
		
    IF OBJECT_ID('SQLNET_Eval') IS NOT NULL
        BEGIN		
            DROP PROCEDURE SQLNET_Eval;
        END;

	IF OBJECT_ID('SQLNET_EvalTVF_1') IS NOT NULL
        BEGIN		
            DROP FUNCTION SQLNET_EvalTVF_1;
        END;

	IF OBJECT_ID('SQLNET_EvalTVF_2') IS NOT NULL
        BEGIN		
            DROP FUNCTION SQLNET_EvalTVF_2;
        END;
	
	IF OBJECT_ID('SQLNET_EvalTVF_3') IS NOT NULL
        BEGIN		
            DROP FUNCTION SQLNET_EvalTVF_3;
        END;

	IF OBJECT_ID('SQLNET_EvalTVF_4') IS NOT NULL
        BEGIN		
            DROP FUNCTION SQLNET_EvalTVF_4;
        END;

	IF OBJECT_ID('SQLNET_EvalTVF_5') IS NOT NULL
        BEGIN		
            DROP FUNCTION SQLNET_EvalTVF_5;
        END;
		
	IF OBJECT_ID('SQLNET_EvalTVF_5') IS NOT NULL
        BEGIN		
            DROP FUNCTION SQLNET_EvalTVF_5;
        END;

	IF OBJECT_ID('SQLNET_EvalTVF_String') IS NOT NULL
        BEGIN		
            DROP FUNCTION SQLNET_EvalTVF_String;
        END;
		
    IF TYPE_ID('SQLNET') IS NOT NULL
        BEGIN
            DROP TYPE SQLNET;
        END;

    IF EXISTS ( SELECT  1
                FROM    sys.assemblies
                WHERE   name = 'Z.Expressions.SqlServer.Eval' )
        BEGIN
            DROP ASSEMBLY [Z.Expressions.SqlServer.Eval];
        END

    IF EXISTS ( SELECT  1
                FROM    sys.assemblies
                WHERE   name = 'Z.Expressions.Compiler' )
        BEGIN
            DROP ASSEMBLY [Z.Expressions.Compiler];
        END;

	/*
	 * INSTALL
	 */
    PRINT N'Install new version...'

    IF EXISTS ( SELECT  1
                FROM    sys.configurations conf
                WHERE   conf.configuration_id = 1562 -- "clr enabled"
                        AND conf.value_in_use = 0 )
        BEGIN
            EXEC(N'EXEC sp_configure ''clr enabled'', 1;');

            EXEC(N'RECONFIGURE');
			-- EXEC(N'RECONFIGURE --WITH OVERRIDE'); -- Use this line instead if you receive the error: "ad hoc changes are not allowed"
        END;

    CREATE ASSEMBLY [Z.Expressions.Compiler]
    AUTHORIZATION [dbo]
    FROM 
	WITH PERMISSION_SET = SAFE;
	
	CREATE ASSEMBLY [Z.Expressions.SqlServer.Eval]
    AUTHORIZATION [dbo]
    FROM 
	WITH PERMISSION_SET = SAFE
	-- WITH PERMISSION_SET = EXTERNAL_ACCESS
	-- WITH PERMISSION_SET = UNSAFE
	;

    CREATE TYPE [dbo].[SQLNET] EXTERNAL NAME [Z.Expressions.SqlServer.Eval].[Z.Expressions.SqlServer.Eval.SQLNET];
    EXEC('CREATE PROCEDURE [SQLNET_EvalResultSet] @sqlnet [SQLNET] AS EXTERNAL NAME [Z.Expressions.SqlServer.Eval].[Z.Expressions.SqlServer.Eval.SQLNET].[SQLNET_EvalResultSet]')
	EXEC('CREATE FUNCTION [dbo].[SQLNET_EvalTVF_1] (@sqlnet [dbo].[SQLNET]) RETURNS TABLE ([Value_1] SQL_VARIANT NULL) AS EXTERNAL NAME [Z.Expressions.SqlServer.Eval].[Z.Expressions.SqlServer.Eval.SQLNET].[SQLNET_EvalTVF_1]')
	EXEC('CREATE FUNCTION [dbo].[SQLNET_EvalTVF_2] (@sqlnet [dbo].[SQLNET]) RETURNS TABLE ([Value_1] SQL_VARIANT NULL, [Value_2] SQL_VARIANT NULL) AS EXTERNAL NAME [Z.Expressions.SqlServer.Eval].[Z.Expressions.SqlServer.Eval.SQLNET].[SQLNET_EvalTVF_2]')
	EXEC('CREATE FUNCTION [dbo].[SQLNET_EvalTVF_3] (@sqlnet [dbo].[SQLNET]) RETURNS TABLE ([Value_1] SQL_VARIANT NULL, [Value_2] SQL_VARIANT NULL, [Value_3] SQL_VARIANT NULL) AS EXTERNAL NAME [Z.Expressions.SqlServer.Eval].[Z.Expressions.SqlServer.Eval.SQLNET].[SQLNET_EvalTVF_3]')
	EXEC('CREATE FUNCTION [dbo].[SQLNET_EvalTVF_4] (@sqlnet [dbo].[SQLNET]) RETURNS TABLE ([Value_1] SQL_VARIANT NULL, [Value_2] SQL_VARIANT NULL, [Value_3] SQL_VARIANT NULL, [Value_4] SQL_VARIANT NULL) AS EXTERNAL NAME [Z.Expressions.SqlServer.Eval].[Z.Expressions.SqlServer.Eval.SQLNET].[SQLNET_EvalTVF_4]')
	EXEC('CREATE FUNCTION [dbo].[SQLNET_EvalTVF_5] (@sqlnet [dbo].[SQLNET]) RETURNS TABLE ([Value_1] SQL_VARIANT NULL, [Value_2] SQL_VARIANT NULL, [Value_3] SQL_VARIANT NULL, [Value_4] SQL_VARIANT NULL, [Value_5] SQL_VARIANT NULL) AS EXTERNAL NAME [Z.Expressions.SqlServer.Eval].[Z.Expressions.SqlServer.Eval.SQLNET].[SQLNET_EvalTVF_5]')
	EXEC('CREATE FUNCTION [dbo].[SQLNET_EvalTVF_String] (@sqlnet [dbo].[SQLNET]) RETURNS TABLE ( [Value_1] NVARCHAR (MAX) NULL) AS EXTERNAL NAME [Z.Expressions.SqlServer.Eval].[Z.Expressions.SqlServer.Eval.SQLNET].[SQLNET_EvalTVF_String]')

    COMMIT;
    PRINT N'Completed!'

END TRY
BEGIN CATCH
	/*
	 * CATCH ERROR
	 */
    PRINT 'An error occured: ' + ERROR_MESSAGE()
    IF ( @@TRANCOUNT > 0 )
        BEGIN
            PRINT 'Rolling back the TRANSACTION...'
            ROLLBACK TRAN
            PRINT 'Done.'
        END
END CATCH

/*
* ROLLBACK UNCATCH ERROR
*/
IF ( @@TRANCOUNT > 0 )
    BEGIN
        PRINT 'An error occured and the CATCH Block was skipped; Rolling back the TRANSACTION...'
        ROLLBACK TRAN
        PRINT 'Done.'
    END